import React, { useEffect, useState } from 'react';

function App2() {
    const [data, setData] = useState([]);
    useEffect(() => {
        fetch('/').then(res => res.json())
        .then(data => setData(data));
    }, []);

    return (
        <div>
        <h1>
            {data}
        </h1>
      </div>
    )
  }

export default App2;
